import React from 'react';
import '../Style/Footer.scss';

const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer__title">Bau Journal</div>
      <div className="footer__column">
        <div className="footer__column-title">Journal</div>
        <a href="#" className="footer__link">Home</a>
        <a href="#" className="footer__link">Papers</a>
        <a href="#" className="footer__link">Write</a>
        <a href="#" className="footer__link">Contact</a>
        <a href="#" className="footer__link">Login</a>
        <a href="#" className="footer__link">About</a>
      </div>
      <div className="footer__date">2023</div>
      <a href="mailto:m.daya.nutrino@gmail.com" className="footer__email">m.daya.nutrino@gmail.com</a>
    </footer>
  );
}

export default Footer;
